const { kavachIndicatorGreenoff, kavachIndicatorGreenon, kavachIndicatorRedon, kavachIndicatorRedoff,
    redIndicatorOn, redIndicatorOff, blackIndicatorOn, blackIndicatorOff, blueIndicatorOn, blueIndicatorOff,
    leadingIcon, nonleadingIcon,Indicatorredon,Indicatorredoff,Indicatorgreenon,Indicatorgreenoff,indicatorbuttonyellowoff ,
    indicatorbuttonyellowon} = Icons.DDUIcons
const {cib_container} = classes;
export const LedIndicator = ({ status, type }) => {
    const indicators = {
        red: {
            on: kavachIndicatorRedon,
            off: kavachIndicatorRedoff
        },
        green: {
            on: kavachIndicatorGreenon,
            off: kavachIndicatorGreenoff
        }
    };

    const src = indicators[type]?.[status ? 'on' : 'off'];
    const size = status ? '100%' : '50%';

    return (
        <div style={{
            height: '100%',
            width: '100%',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center'
        }}>
            {src && <img style={{ height: size, width: size }} src={src} alt={`${type} indicator`} />}
        </div>
    );
};


export const KavachButtons = ({ state, type, style,currentData = false,publishdata }) => {
    const [isOn, setIsOn] = useState(currentData);

    const handleToggle = () => {
        const newState = !isOn;
        setIsOn(newState);
        state(newState);
        if(publishdata){
            if(publishdata.type === 'scancel'){
                websocket.publish('FE/BE/SKAVACH',{btn_cancel:newState})
            }
            if(publishdata.type === 'ssos'){
                websocket.publish('FE/BE/SKAVACH',{btn_sos:newState})
            }
            if(publishdata.type === 'ttskAck'){
                websocket.publish('FE/BE/SKAVACH',{btn_tsr_ack:newState})
            }
            
        }
    };

    
    const indicators = {
        red: { on: redIndicatorOn, off: redIndicatorOff },
        black: { on: blackIndicatorOn, off: blackIndicatorOff },
        blue: { on: blueIndicatorOn, off: blueIndicatorOff },
        leading: { on: leadingIcon, off: nonleadingIcon },
        yellow:{ on: indicatorbuttonyellowon, off:indicatorbuttonyellowoff },
    };

    const currentIndicator = indicators[type]?.[isOn ? 'on' : 'off'];

    return (
        <div
            onClick={handleToggle}
            style={{
                height: '100%',
                width: '100%',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                cursor: 'grabbing',
                ...style,
            }}
        >
            {currentIndicator && (
                <img
                    style={{
                        height: '90%', width: '90%',
                        transition: 'opacity 0.3s ease, transform 0.3s ease',

                    }}
                    src={currentIndicator}
                    alt={`${type} indicator`}
                />
            )}
        </div>
    );
};

