export const ColorIndicator = ({color,status}) => {
    return(
        <div style={{height:'100%',width:'100%',}} >
           {
           (status && color === 'red') &&
           <img style={{height:'100%',width:'100%'}} src={Indicatorredon}/>
           }
                      {
           (!status && color === 'red') &&
           <img style={{height:'100%',width:'100%'}} src={Indicatorredoff}/>
           }
                      {
           (status && color === 'green') &&
           <img style={{height:'100%',width:'100%'}} src={Indicatorgreenon}/>
           }
                      {
           (!status && color === 'green') &&
           <img style={{height:'100%',width:'100%'}} src={Indicatorgreenoff}/>
           }
        </div>
      )

}










